const Index = () => {
  return (
    <>
      <div className="container">
        <div className="main">
          <div className="chat"></div>
          <input />
          <button>SEND</button>
        </div>
      </div>

      <style jsx>{`
        body {
          margin: 0px;
        }
        .container {
          display: flex;
          box-sizing: border-box;
        }
        .main {
          box-sizing: border-box;
          position: relative;
          margin: auto;
          border: 1px black solid;
          border-radius: 10px;
          height: 90vh;
          width: 50%;
        }
        .chat {
          width: 100%;
          height: 93%;
          border-radius: 10px;
          background-color: pink;
        }
        input {
          position: absolute;
          right: 0px;
        }
      `}</style>
    </>
  );
};

export default Index;
